import React from "react";
import e from "../images/play.png";
const CurrentEvents = () => {
  return (
    <section className="current  py-5">
      <div className="container-fluid">
        <div className="row current__cards-box">
          <div className="col-md-3 current__card current__card--1">
          <img src={e} alt=""/>
          </div>
          <div className="col-md-3 current__card current__card--2">
          </div>
          <div className="col-md-3 current__card current__card--3"></div>
          <div className="col-md-3 current__card current__card--4"></div>
        </div>
      </div>
    </section>
  );
};

export default CurrentEvents;
